import React, { InputCheckbox } from 'react';
import { Row, Col, Table, Card, Button } from 'react-bootstrap';

import KKTable from './table';

const Checkbox = ({ value, onChange }) => {
    return (
        <input type="checkbox" checked={value} onChange={onChange} />
    );
};

const SamplePage = () => {
    return (
        <React.Fragment>
            <Card>
                <Card.Body>
                    <Row>
                        <Col xl={12}>
                            <Button variant="secondary" style={{float: "left"}}>Marcar como lido{" "}<i className="feather icon-check" style={{margin:"0"}}/></Button>
                            <Button variant="secondary" style={{float: "left"}}>Excluir{" "}<i className="feather icon-trash" style={{margin:"0"}}/></Button>
                        </Col>
                        <Col xl={12}>
                        <Table responsive>
                                <tbody>
                                    <tr className="unread">
                                        <td className="col-xl-2"><Checkbox /></td>
                                        <td className="col-xl-10">Mensagem</td>
                                    </tr>
                                </tbody>
                            </Table>
                        </Col>
                        <Col xl={12}>
                            <Table responsive>
                                <tbody>
                                    <tr className="unread">
                                        <td className="col-xl-2"><Checkbox /></td>
                                        <td className="col-xl-10"></td>
                                    </tr>
                                </tbody>
                            </Table>
                        </Col>
                    </Row>
                </Card.Body>
            </Card>
        </React.Fragment>
    );
};

export default SamplePage;
